Verenigde Staten / Verenigd Koninkrijk
Komedie
93 minuten

geregisseerd door Rob Meltzer
met Jean-Claude Van Damme, Adam Brody en Rob Huebel

De film vertelt het verhaal van Chris (Adam Brody). Hij is op het werk een slappeling die niet durft op te staan tegen de kantoorpestkop Phil (Rob Huebel). Tijdens een zogenaamde wildernis seminar op een tropisch eiland loopt het mis en wordt coach Storm Rothschild (Van Damme) aangevallen door een poema. Het moment voor Chris om wel op te staan en zich te bewijzen.



